  true,\n\t\"url\": null,\n\t\"notes\": \"A supervised learning task involves constructing
  a mapping from an input data space (normally described by several features) to an
  output space. A set of training examples---examples with known output values---is
  used by a learning algorithm to generate a model. This model is intended to approximate
  the mapping between the inputs and outputs. This model can be used to generate predicted
  outputs for inputs that have not been seen before. Within supervised learning, one
  type of task is a classification learning task, in which each output consists of
  one or more classes to which the corresponding input belongs. For example, we may
  have data consisting of observations of sunspots.  In a classification learning
  task, our goal may be to learn to classify sunspots into one of several types.  Each
  example may correspond to one candidate sunspot with various measurements or just
  an image.  A learning algorithm would use the supplied examples to generate a model
  that approximates the mapping between each supplied set of measurements and the
  type of sunspot.  This model can then be used to classify previously unseen sunspots
  based on the candidate's measurements. In this chapter, we explain several basic
  classification algorithms.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
